import React from "react";
import { FaShoppingBag } from "react-icons/fa";

const Nav = () => {
  return (
    <>
      <div className="header">
        <div className="top-header">
          <div className="icon">
            <FaShoppingBag />
          </div>
          <div className="info">
            <p></p>
          </div>
        </div>
      </div>
    </>
  );
};

export default Nav;
